import sys
import time

def lcs(str_1, str_2):
    # print('{},{}'.format(len(str_1), len(str_2)))

    if (len(str_1) == 0) or (len(str_2) == 0):
        return ''
    elif str_1[-1] == str_2[-1]:
        return lcs(str_1[:-1], str_2[:-1]) + str_1[-1]
    else:
        lcs_1 = lcs(str_1[:-1], str_2)
        lcs_2 = lcs(str_1,      str_2[:-1])
        if len(lcs_1) > len(lcs_2):
            return lcs_1
        else:
            return lcs_2


if __name__ == '__main__':
    if False:
        str_1, str_2 = sys.argv[1], sys.argv[2]
        # str_1, str_2 = 'XMJYAUZ', 'MZJAWXU'
        # str_1, str_2 = 'abcdefg', 'xaxcxexgx'

        start = time.time()

        print('{}'.format(lcs(str_1, str_2)))

        elapsed = time.time() - start
        print('elapsed = {:1.3e}'.format(elapsed))

    else:
        sys.setrecursionlimit(10000)
        str_1 = ''
        str_2 = ''
        tlcs  = ''

        alcs = lcs(str_1, str_2)

        # print('T = {}'.format(tlcs))
        print('A = {}'.format(alcs))

